import React, { Component } from 'react';
import HomeContainer from '../src/components/home.js';

class App extends Component {
    render() {
        return (
            <div className = "App">
                <header className = "App-header">
                    <HomeContainer/>
                </header>
            </div>
        );
    }
}
export default App;
